import React from 'react';
import { NavLink, useNavigate } from 'react-router-dom';
import * as PropTypes from 'prop-types';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';
import styles from './Header.module.css';
import Logo from '../../images/Logo.png';
import FeatherIcon from '../../images/feather.png';
import DropdownMenu from '../DropdownMenu/DropdownMenu';

function Header({ user, setUser }) {
  const navigate = useNavigate();
  const disconnect = () => {
    localStorage.clear();
    setUser(null);
    navigate('/');
  };

  const categories = ['Amour', 'Aventure', 'Fantastique', 'Fantasy', 'Historique', 'Policier', 'Science-Fiction'];

  const handleCategorySelect = (category) => {
    navigate(`/category/${category.toLowerCase()}`);
  };
  return (
    <header className={styles.Header}>
      <div className={styles.container}>
        <img className={styles.logo} src={Logo} alt="logo WonderBook" />
        <div className={styles.navBar}>
          <ul>
            <li>
              <NavLink to="/" end className={({ isActive }) => (isActive ? styles.activeLink : undefined)}>
                Accueil
              </NavLink>
            </li>
            <li>
              <DropdownMenu categories={categories} onSelectCategory={handleCategorySelect} />
            </li>
            <li>
              <NavLink to="/" className={({ isActive }) => (isActive ? styles.activeLink : undefined)}>
                Années
              </NavLink>
            </li>
            <li>
              <NavLink to="/" className={({ isActive }) => (isActive ? styles.activeLink : undefined)}>
                Forum
              </NavLink>
            </li>
            <li>
              <NavLink to="/" className={({ isActive }) => (isActive ? styles.activeLink : undefined)}>
                Ma collection
              </NavLink>
            </li>
            <li>
              <button id={styles.Button} type="button" onClick={!user ? () => navigate('/AddBook') : disconnect} onKeyUp={!user ? () => navigate('/AddBook') : disconnect} className={styles.activeLink} aria-label={!user ? 'Se connecter' : 'Se déconnecter'}>
                {!user ? 'AddBook' : 'Se déconnecter'}
                <img src={FeatherIcon} alt="Feather Icon" className={styles.icon} />
              </button>
            </li>
          </ul>
        </div>
        <div className={styles.content}>
          <div className={styles.Button}>
            <button
              type="button"
              onClick={!user ? () => navigate('/Login') : disconnect}
              onKeyUp={!user ? () => navigate('/Login') : disconnect}
              className={styles.activeLink}
              aria-label={!user ? 'Se connecter' : 'Se déconnecter'}
            >
              {!user ? 'Se connecter' : 'Se déconnecter'}
              <img
                src={FeatherIcon}
                alt="Feather Icon"
                className={styles.icon}
              />
            </button>
            <button type="button" onClick={!user ? () => navigate('/Register') : disconnect} onKeyUp={!user ? () => navigate('/Register') : disconnect} className={styles.activeLink} aria-label={!user ? 'Se connecter' : 'Se déconnecter'}>
              {!user ? 'Inscription' : 'Se déconnecter'}
              <img src={FeatherIcon} alt="Feather Icon" className={styles.icon} />
            </button>
          </div>
          <div className={styles.searchBar}>
            <div className={styles.inputSearch}>
              <input type="text" />
              <button type="button">
                <FontAwesomeIcon icon={faMagnifyingGlass} />
              </button>
            </div>
          </div>
        </div>
      </div>
    </header>
  );
}

Header.propTypes = {
  user: PropTypes.shape({
    userId: PropTypes.string,
    token: PropTypes.string,
  }),
  setUser: PropTypes.func.isRequired,
};

Header.defaultProps = {
  user: null,
};

export default Header;
